import React from "react";
import Header from "../../components/Header";
import css from "./index.module.scss";
function Page({ pageApi }) {
  console.log(pageApi);
  return (
    <React.Fragment>
      <Header selectedPage={pageApi} />
      <div className={css.root}></div>
    </React.Fragment>
  );
}

export default Page;
